declare @N int
set @N =
	(	select	count(*)
		from	#ResourceTranslations
	)
PRINT(N'Operation applied to ' + cast(@N as nvarchar(20)))
PRINT N''

--------------Select not existing resources which translations have been provided----------------------

set @N =
	(	select	count(*)
		from		#ResourceTranslations rtr
		left join	trtResource r
		on			r.idfsResource = rtr.idfsResource
		where		r.idfsResource is null
	)

if @N > 0
begin
	print N'!!!!!There is(are) ' + cast(@N as nvarchar(20)) + N' not existing resources which translations have been provided!!!!'
	print N'No translations will be applied. Add missing resources and execute script again.'

	select			rtr.*
		from		#ResourceTranslations rtr
		left join	trtResource r
		on			r.idfsResource = rtr.idfsResource
		where		r.idfsResource is null
end
else begin


PRINT N'Processing #ResourceTranslations - GG at ' + CAST(GETDATE() AS NVARCHAR(24))
declare @idfsLanguageGG bigint
set @idfsLanguageGG = dbo.FN_GBL_LanguageCode_GET('ka-GE')

PRINT N'Update existing GG Translations'
UPDATE		rtr_ex
SET			rtr_ex.strResourceString = rtr.strkaGE,
			rtr_ex.intRowStatus = 0,
			rtr_ex.SourceSystemNameID = rtr.SourceSystemNameID,
			rtr_ex.SourceSystemKeyValue = rtr.GG_SourceSystemKeyValue,
			rtr_ex.AuditCreateUser = 'System',
			rtr_ex.AuditUpdateDTM = GETDATE()
from		#ResourceTranslations rtr
inner join	trtResource r
on			r.idfsResource = rtr.idfsResource
inner join	trtResourceTranslation rtr_ex
on			rtr_ex.idfsResource = rtr.idfsResource
			and rtr_ex.idfsLanguage = @idfsLanguageGG
where		rtr.strkaGE is not null
			and (	rtr_ex.strResourceString is null
					or	rtr_ex.strResourceString <> rtr.strkaGE
				)
print N'Updated records: ' + cast(@@rowcount as nvarchar(20))
print N''

PRINT N'Insert new GG Translations'
	idfsResource,
	idfsLanguage,
	strResourceString,
	rowguid,
	intRowStatus,
	SourceSystemNameID,
	SourceSystemKeyValue,
	AuditCreateUser,
	AuditCreateDTM
)
SELECT		r.idfsResource,
			@idfsLanguageGG,
			rtr.strkaGE,
			rtr.rowguid,
			0,
			rtr.SourceSystemNameID,
			rtr.GG_SourceSystemKeyValue,
			'System',
			GETDATE()
from		#ResourceTranslations rtr
inner join	trtResource r
on			r.idfsResource = rtr.idfsResource
left join	trtResourceTranslation rtr_ex
on			rtr_ex.idfsResource = rtr.idfsResource
			and rtr_ex.idfsLanguage = @idfsLanguageGG
where		rtr.strkaGE is not null
			and rtr_ex.idfsResource is null
print N'Inserted records: ' + cast(@@rowcount as nvarchar(20))
print N''



print N''
PRINT N'Processing #ResourceTranslations - RU at ' + CAST(GETDATE() AS NVARCHAR(24))
declare @idfsLanguageRU bigint
set @idfsLanguageRU = dbo.FN_GBL_LanguageCode_GET('ru-RU')

PRINT N'Update existing RU Translations'
UPDATE		rtr_ex
SET			rtr_ex.strResourceString = rtr.strruRU,
			rtr_ex.intRowStatus = 0,
			rtr_ex.SourceSystemNameID = rtr.SourceSystemNameID,
			rtr_ex.SourceSystemKeyValue = rtr.RU_SourceSystemKeyValue,
			rtr_ex.AuditCreateUser = 'System',
			rtr_ex.AuditUpdateDTM = GETDATE()
from		#ResourceTranslations rtr
inner join	trtResource r
on			r.idfsResource = rtr.idfsResource
inner join	trtResourceTranslation rtr_ex
on			rtr_ex.idfsResource = rtr.idfsResource
			and rtr_ex.idfsLanguage = @idfsLanguageRU
where		rtr.strruRU is not null
			and (	rtr_ex.strResourceString is null
					or	rtr_ex.strResourceString <> rtr.strruRU
				)
print N'Updated records: ' + cast(@@rowcount as nvarchar(20))
print N''

PRINT N'Insert new RU Translations'
	idfsResource,
	idfsLanguage,
	strResourceString,
	rowguid,
	intRowStatus,
	SourceSystemNameID,
	SourceSystemKeyValue,
	AuditCreateUser,
	AuditCreateDTM
)
SELECT		r.idfsResource,
			@idfsLanguageRU,
			rtr.strruRU,
			rtr.rowguid,
			0,
			rtr.SourceSystemNameID,
			rtr.RU_SourceSystemKeyValue,
			'System',
			GETDATE()
from		#ResourceTranslations rtr
inner join	trtResource r
on			r.idfsResource = rtr.idfsResource
left join	trtResourceTranslation rtr_ex
on			rtr_ex.idfsResource = rtr.idfsResource
			and rtr_ex.idfsLanguage = @idfsLanguageRU
where		rtr.strruRU is not null
			and rtr_ex.idfsResource is null
print N'Inserted records: ' + cast(@@rowcount as nvarchar(20))
print N''

-- DROP TEMP TABLE
PRINT N'Dropping #ResourceTranslations at ' + CAST(GETDATE() AS NVARCHAR(24))

end

IF OBJECT_ID('tempdb..#ResourceTranslations') IS NOT NULL
BEGIN
	exec sp_executesql N'drop table #ResourceTranslations'
END

set nocount off

